import React, { Component } from 'react';
import './Header.css';
import Icon from './symitems.png'

class Header extends Component {

  render() {
    return (
      <div className="header">
        <img src={Icon} alt="" />
        <div className="header-title">
          <h3>共通ヘッダだよ</h3>
        </div>
      </div>
    );
  }
}

export default Header;
